message:
Penso que estamos com três frentes de batalha:

1. Espiritual, individual e com consequências no coletivo;

2. Cibernética, de Estado e PODER;

3. Narrativa, aquela que dá sustentação às duas anteriores.


Resta-nos estarmos cientes de quem somos e queremos, conforme nossas necessidades e valores.
Que Deus nos proteja e dê Sabedoria.❤️🇧🇷
